// Home.jsx
import sampleBooks from "./sampleBooks";
import BookCard from "./BookCard";

const Home = () => {
  return (
    <div className="home-container">
      <h1>Popular Books</h1>
      <div className="books-grid">
        {sampleBooks.map((book) => (
          <BookCard key={book._id} book={book} />
        ))}
      </div>
    </div>
  );
};

export default Home;
